"Jūsų įrenginys kaista. Bus imtasi veiksmų, kad jis atvėstų.

Galite toliau naudotis savo įrenginiu, tačiau:
– ekranas gali pritemti;
– įrenginio veikimas gali sulėtėti;
– gali būti pristabdytas įkrovimas.

Kai įrenginys atvės, jis automatiškai pradės veikti įprastai."

"Jūsų įrenginys perkaito. Jis išjungtas, kad nebūtų sugadintas.

Įrenginys gali perkaisti:
– ilgą laiką veikiant daug grafinių duomenų naudojančioms programoms, pvz., žaidimams ir navigacijos programoms;
– perkeliant didelius failus;
– naudojantis įrenginiu karštoje aplinkoje."
